content:
Vamos relembrar quais deputados foram pedir pro Ministro da Justiça aliviar a do IMpastor estuprador? A lista é:

Marco Feliciano (PSC-SP);
Pastor Eurico (PSB-PB);
Francisco Floriano (PR-RJ);
Adrian Mussi (PMDB-RJ);
João Campos (PSDB-GO);
Alexandre Santos (PMDB-RJ);
Washington Reis (PMDB-RJ);
Jair Bolsonaro (PP-RJ);
Roberto Lucena (PV-SP);
José Olimpio (PP-SP);
Leonardo Quintão (PMDB-MG);
Zequinha Marinho (PSC-PA);
Eduardo da Fonte (PP-PE);
Costa Ferreira (PSC-MA);
Anthony Garotinho (PP-RJ);
Fernando Jordão (PMDB-RJ);
Arolde de Oliveira (PSD-RJ);
Aureo Lídio Moreira Ribeiro (PRTB-RJ).

2008 - Perdeu o Título na última curva no Brasil, se ele tivesse ganho o campeonato em casa seria um feito que nem um outro piloto brasileiro teria (nem o Senna);
2009 - Sofreu um sério acidente;
2010 - Fator Alonso.
Esses três episódios acabaram com a carreira dele, não conseguiu se reerguer. O difícil agora vai ser achar uma equipe que pague para ele correr e não o contrario.

Algumas considerações:
- Moreno, Rubinho, Massa, Piquet Jr, B.Sena e etc... sempre foram coadjuvantes na F1;
- Massa sabia do que tinha que fazer, pois leu e assinou um contrato. Honrou o contrato / desonrou o esporte;
- O Galvão não vai mais poder dizer tantas besteiras sobre os pilotos brasileiros ( graças a Deus ! );
- Agora, o Massa deveria mostrar serviço e fazer tudo para atrapalhar o Fernando Dick Vigarista Alonso..... pelo menos ia ser muito divertido de ver....rs...
